	function getQuadraticBezierMidpoint(x1, y1, cx, cy, x2, y2) {
    const t = 0.5;
    const x = (1 - t) * (1 - t) * x1 + 2 * (1 - t) * t * cx + t * t * x2;
    const y = (1 - t) * (1 - t) * y1 + 2 * (1 - t) * t * cy + t * t * y2;
    return { x, y };
  }

